// import EmojiResults from "./EmojiResults";
import SideNav from './components/sideNav';
import SearchInput from "./components/SearchInput";
import { createTheme, ThemeProvider } from '@material-ui/core/styles';

const theme = createTheme({
  props: {
    // Name of the component ‚öõÔ∏è
    MuiGrid: {
      // The default props to change
      width: 100, // No more ripple, on the whole application üí£!
    },
  },
});


export default class App extends PureComponent {



  render() {

    return (
    <ThemeProvider theme={theme}>
      <div>
    <div className="App">
    <SideNav></SideNav>

      <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
      <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,700&display=swap" />
      <header className="App-header">

      {/* <Grid
      direction="column"
      justifyContent="flex-start"
      alignItems="flex-start"
      className="SearchBox">

      </Grid> */}


        <Grid
         className="landingContent"
          container 
          direction={'row'}
          justifyContent='center'
          Props
         >

          <Grid item xs={7}><TextField color="primary" InputLabelProps={{className: 'textfield__label'}} className="searchBox" id="outlined-basic" label="Search" variant="outlined" /></Grid>
          <Grid item xs={7}>
            <Paper className>xs=6</Paper>
          </Grid>
        </Grid>

      </header>
    </div>
      </div>
      </ThemeProvider>
    );
  }
}
